import React from 'react';
import './App.css';
import NavBar from './NavBar';
import Header from './Header';
import AdminNew from './AdminNew';
import AdminLogin from './AdminLogin';
import AdminCategory from './AdminCategory';
import AdminDeleteUpdate from './AdminDeleteUpdate';
import AdminUpdate from './AdminUpdate';
import Bags from './Bags';
import Bag from './Bag';
import Homepage from './Homepage';
import Footer from './Footer';
//import {NavLink} from 'react-router-dom'

import {
    BrowserRouter as Router,
    Route
} from 'react-router-dom'
import UserRegisterForm from './UserRegisterForm';
import UserBuy from './UserBuy';
import ShoppingCart from './ShoppingCart';
import OrderMsg from './OrderMsg';
import Favorites from './Favorites';
import UserLogin from './UserLogin';
import Products from './Products';
import Sidebar from './SideBar';



export default class MyRouter extends React.Component{
  render() {
    return (
      <Router>
        <div>
          <Header/>
          <NavBar/>
          <Route  exact path = "/sidebar" component = {Sidebar}/>
          <Route  exact path = "/" component = {Homepage}/>
          <Route  exact path = "/bags" component = {Bags}/>
          <Route  path = "/products" component = {Products}/>
          <Route  exact path = "/bags/:id" component = {Bag}/>
          <Route exact path = '/favorites' component = {Favorites}/>
          <Route  exact path = "/shoppingcart" component = {ShoppingCart}/>
          <Route  exact path = "/register" component = {UserRegisterForm}/>
          <Route exact path = "/thankyou" component ={OrderMsg}/>
          <Route  exact path = "/buy" component = {UserBuy}/>
          <Route exact path = "/login" component = {UserLogin}/>
          <Route  exact path = "/admin" component = {AdminLogin}/>
          <Route  exact path = "/admin/category" component = {AdminCategory}/>
          <Route  exact path = "/admin/category/new" component = {AdminNew}/>
          <Route  exact path = "/admin/category/deleteupdate" component = {AdminDeleteUpdate}/>
          <Route  exact path = "/admin/category/update" component = {AdminUpdate}/>
          <Footer/>
        </div>
      </Router>
    );
  }
}
